import React, { useState } from 'react';
import { Button, TextField, Box } from '@mui/material';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import IconButton from '@mui/material/IconButton';
import VisibilityIcon from '@mui/icons-material/Visibility';
import EmployeeForm from './employeeForm';
import EmployeeEdit from './employeeEdit'; 
import EmployeeDetails from './employeeDetails'; // Добавлен импорт компонента EmployeeDetails
import Popup from './Popup'; // Добавлен импорт компонента Popup
import data from '../data.json';
import '../styles/accounting.css';

function Accounting() {
    const [isFormVisible, setIsFormVisible] = useState(false);
    const [isEditFormVisible, setIsEditFormVisible] = useState(false);
    const [isDetailsVisible, setIsDetailsVisible] = useState(false); // Состояние для отображения деталей сотрудника
    const [selectedEmployee, setSelectedEmployee] = useState(null);

    const handleOpenForm = () => {
        setIsFormVisible(true);
    };

    const handleCloseForm = () => {
        setIsFormVisible(false);
    };

    const handleOpenEditForm = (employee) => {
        setSelectedEmployee(employee);
        setIsEditFormVisible(true);
    };

    const handleCloseEditForm = () => {
        setSelectedEmployee(null);
        setIsEditFormVisible(false);
    };

    const handleShowDetails = (employee) => {
        setSelectedEmployee(employee);
        setIsDetailsVisible(true);
    };

    const handleCloseDetails = () => {
        setSelectedEmployee(null);
        setIsDetailsVisible(false);
    };

    return (
        <div>
            {isFormVisible && (
                <EmployeeForm onCloseForm={handleCloseForm} />
            )}

            {isEditFormVisible && selectedEmployee && (
                <EmployeeEdit 
                    employeeData={selectedEmployee} 
                    onCloseModal={handleCloseEditForm} 
                />
            )}

            {/* Модальное окно для отображения деталей сотрудника */}
            <Popup isOpen={isDetailsVisible} onClose={handleCloseDetails}>
                <EmployeeDetails employee={selectedEmployee} />
            </Popup>

            <div style={{ marginBottom: '10px' }}>
                <TextField
                    id="search"
                    label="Поиск"
                    variant="outlined"
                />
                <label>
                    Сортировать по:
                    <select>
                        <option value="name">Имени</option>
                    </select>
                </label>
            </div>

            <table className="employee-table">
                <thead>
                    <tr>
                        <th>Имя</th>
                        <th>Должность</th>
                        <th>Допуск</th>
                        <th>Действие</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((employee, index) => (
                        <tr key={index}>
                            <td>{employee.name}</td>
                            <td>{employee.position}</td>
                            <td>{employee.access}</td>
                            <td>
                                <IconButton aria-label="details" onClick={() => handleShowDetails(employee)}>
                                    <VisibilityIcon />
                                </IconButton>
                                <IconButton color="primary" aria-label="edit" onClick={() => handleOpenEditForm(employee)}>
                                    <EditIcon />
                                </IconButton>
                                <IconButton color="secondary" aria-label="delete">
                                    <DeleteIcon />
                                </IconButton>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <div className="containeradd text-center">
                <Fab color="primary" aria-label="add" onClick={handleOpenForm}>
                    <AddIcon />
                </Fab>
            </div>
        </div>
    );
}

export default Accounting;
